import React from 'react';
import '../styles/heroInfo.css';


const HeroInfo = (props) => {
    return (<React.Fragment>
        <div className="hero-data__block">
            <h3 className="hero-data__title">{props.title}</h3>
            <div className="hero-data__text">{props.text}</div>
        </div>
    </React.Fragment>)
}

export default HeroInfo;
